"use strict";(self.webpackChunktwo=self.webpackChunktwo||[]).push([[482],{5159:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"/3_6_7","metadata":{"permalink":"/id/3_6_7","source":"@site/i18n/id/docusaurus-plugin-content-blog/3_6_7/index.mdx","title":"YouTube\u2122 Dual Caption 3.6.7 Memperbarui Catatan","description":"Buka kunci kualitas video","date":"2022-04-27T00:00:00.000Z","formattedDate":"27 April 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-27T00:00:00.000Z"},"nextItem":{"title":"YouTube\u2122 Dual Caption 3.6.6 Memperbarui Catatan","permalink":"/id/3_6_6"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport qualityUnlock from \'./qualityUnlock.png\';\\n\\n\\n\\n\\n### Buka kunci kualitas video\\n\\nSekarang kunci kualitas video default dilepaskan, dan Anda dapat beralih status dengan mengklik, dan Anda perlu menyegarkan halaman setelah beralih status.\\n\\n<img src={qualityUnlock} alt=\\"qualityUnlock.png\\" width=\\"330\\" height=\\"320\\" />\\n\\n<WebStore />"},{"id":"/3_6_6","metadata":{"permalink":"/id/3_6_6","source":"@site/i18n/id/docusaurus-plugin-content-blog/3_6_6/index.mdx","title":"YouTube\u2122 Dual Caption 3.6.6 Memperbarui Catatan","description":"### Perbaiki kunci kualitas video","date":"2022-04-11T00:00:00.000Z","formattedDate":"11 April 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-11T00:00:00.000Z"},"prevItem":{"title":"YouTube\u2122 Dual Caption 3.6.7 Memperbarui Catatan","permalink":"/id/3_6_7"},"nextItem":{"title":"YouTube\u2122 Dual Caption 3.6.5 Memperbarui Catatan","permalink":"/id/3_6_5"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport qualityLock from \'./qualityLock.png\';\\nimport defaultStyle from \'./defaultStyle.png\';\\n\\n\\n\\n\\n ### Perbaiki kunci kualitas video\\n\\n Fungsi kunci kualitas video disediakan di versi 3.6.3, tetapi ketika Otomatis dipilih, kualitas masih terkunci dan tidak dapat disesuaikan secara dinamis. Masalah ini sekarang telah diperbaiki.\\n\\n<img src={qualityLock} alt=\\"qualityLock.png\\" width=\\"276\\" height=\\"389\\" />\\n\\n### Kembalikan gaya default subtitle\\n\\nGaya subtitel prasetel disediakan di versi sebelumnya, dan gaya default subtitel sekarang konsisten dengan YouTube.\\n\\nJika Anda perlu kembali ke gaya default, Anda dapat mengklik tombol Atur Ulang Gaya.\\n\\n<img src={defaultStyle} alt=\\"defaultStyle.png\\" width=\\"340\\" height=\\"524\\" />\\n\\n<WebStore />"},{"id":"/3_6_5","metadata":{"permalink":"/id/3_6_5","source":"@site/i18n/id/docusaurus-plugin-content-blog/3_6_5/index.mdx","title":"YouTube\u2122 Dual Caption 3.6.5 Memperbarui Catatan","description":"### Perbaiki subtitle tidak terbungkus","date":"2022-04-07T00:00:00.000Z","formattedDate":"7 April 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-07T00:00:00.000Z"},"prevItem":{"title":"YouTube\u2122 Dual Caption 3.6.6 Memperbarui Catatan","permalink":"/id/3_6_6"},"nextItem":{"title":"Catatan Pembaruan YouTube\u2122 Dual Caption 3.6.0","permalink":"/id/3_6_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport improveHandle from \'./improveHandle.gif\';\\nimport subtitleRightClickMenu from \'./subtitleRightClickMenu.gif\';\\nimport subtitleTips from \'./subtitleTips.png\';\\nimport subtitleWrap from \'./subtitleWrap.png\';\\n\\n\\n\\n\\n ### Perbaiki subtitle tidak terbungkus\\n\\n Memperbaiki masalah yang menyebabkan subtitle meluap tanpa membungkus saat font terlalu besar di versi sebelumnya.\\n\\n<img src={subtitleWrap} alt=\\"subtitleWrap.png\\" width=\\"600\\" height=\\"698\\" />\\n\\n### Perbaiki perintah subtitle\\n\\nDi versi sebelumnya, prompt subtitle juga akan menggunakan gaya, dan sekarang masalah ini dihindari.\\n\\n<img src={subtitleTips} alt=\\"subtitleTips.png\\" width=\\"600\\" height=\\"682\\" />\\n\\n### Tingkatkan pegangannya\\n\\nTombol handle yang dulu susah di drag saat subtitle di drag ke border, sekarang lebih mudah digunakan dengan merubah posisi handle.\\n\\n<img src={improveHandle} alt=\\"improveHandle.gif\\" width=\\"600\\" height=\\"338\\" />\\n\\n### Subtitle menu klik kanan\\n\\nDi masa lalu, subtitle dapat disalin, tetapi operasi klik kanan tidak dapat dilakukan. Sekarang masalah ini telah diperbaiki.\\n\\n<img src={subtitleRightClickMenu} alt=\\"subtitleRightClickMenu.gif\\" width=\\"600\\" height=\\"313\\" />\\n\\n<WebStore />"},{"id":"/3_6_0","metadata":{"permalink":"/id/3_6_0","source":"@site/i18n/id/docusaurus-plugin-content-blog/3_6_0/index.mdx","title":"Catatan Pembaruan YouTube\u2122 Dual Caption 3.6.0","description":"Perbaiki penggabungan pernyataan","date":"2021-12-16T00:00:00.000Z","formattedDate":"16 Desember 2021","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2021-12-16T00:00:00.000Z"},"prevItem":{"title":"YouTube\u2122 Dual Caption 3.6.5 Memperbarui Catatan","permalink":"/id/3_6_5"},"nextItem":{"title":"Catatan Pembaruan YouTube\u2122 Dual Caption 3.5.0","permalink":"/id/3_5_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport Tip from \'/src/components/Tip\';\\nimport mark from \'./mark.png\';\\nimport disableStyle from \'./disableStyle.gif\';\\nimport order from \'./order.gif\';\\n\\n\\n### Perbaiki penggabungan pernyataan\\n\\n Pada versi sebelumnya, penggabungan pernyataan tidak dilakukan untuk mengikuti perilaku YouTube sendiri.\\n\\nHal ini menyebabkan kalimat menjadi terputus-putus saat memutar video, dan mengunduh subtitle juga menyebabkan timeline menjadi berantakan.\\n\\nDi versi 3.6.0, masalah ini telah diperbaiki dan lebih banyak detail telah dioptimalkan.\\n\\nMenghapus spasi ekstra dalam pernyataan gabungan.\\n\\n```\\n 1\\n 00:00:03,678 --\x3e 00:00:05,960\\n means that many aspects  of our lives\\n \u610f\u5473\u7740 \u6211\u4eec\u751f\u6d3b\u7684\u8bb8\u591a\u65b9\u9762\\n\\n 2\\n 00:00:05,960 --\x3e 00:00:08,214are regulated  by a weird entity.\\n \u90fd \u53d7\u5230\u4e00\u4e2a\u5947\u602a\u7684\u5b9e\u4f53\u7684\u76d1\u7ba1\u3002\\n\\n 3\\n 00:00:09,050 --\x3e 00:00:13,453It feels like a huge bureaucracy is making decisions over our heads.\\n \u611f\u89c9\u5c31\u50cf\u4e00\u4e2a\u5de8\u5927\u7684\u5b98\u50da\u673a\u6784 \u6b63\u5728\u6211\u4eec\u7684\u5934\u8111\u4e2d\u505a\u51fa\u51b3\u5b9a\u3002\\n ```\\n\\nGaris waktu kosong yang dihapus untuk mengunduh subtitle.\\n\\n```\\n 1\\n 00:00:00,000 --\x3e 00:00:00,500\\n\\n\\n\\n 2\\n 00:00:00,500 --\x3e 00:00:03,090\\n PETE LEPAGE: You can now upload extensions using Manifest\\n PETE LEPAGE: \u60a8\u73b0\u5728\u53ef\u4ee5 \u4f7f\u7528 Manifest V3 \u5c06\u6269\u5c55\u7a0b\u5e8f\u4e0a\u4f20\\n\\n 3\\n 00:00:03,090 --\x3e 00:00:05,100\\n V3 to the Chrome Web Store.\\n \u5230 Chrome \u7f51\u4e0a\u5e94\u7528\u5e97\u3002\\n ```\\n\\n### Subtitle ganda mengutamakan subtitle video\\n\\n Dulu subtitle bilingual selalu diterjemahkan dengan mesin, sekarang subtitle video yang ada akan digunakan terlebih dahulu, dan terjemahan mesin akan digunakan jika tidak ada subtitle.\\n\\n Jika video bilingual sudah memiliki subtitle, indikator pengoptimalan akan ditampilkan.\\n\\n Mengunduh subtitle juga akan memiliki optimasi yang sama, dengan tanda centang di tengah nama file.\\n\\n<Tip>Logo menunjukkan bahwa subtitle bilingual saat ini menggunakan subtitle video yang ada, bukan terjemahan mesin.</Tip>\\n\\n<img src={mark} alt=\\"mark.png\\" width=\\"891\\" height=\\"262\\" />\\n\\n### Matikan gaya khusus\\n\\n Versi ini menyediakan opsi untuk menonaktifkan gaya kustom, dan dapat mengatur urutan subtitle dan spasi secara mandiri.\\n\\n<Tip>Tip: Premis dari pengoptimalan ini adalah bahwa kedua subtitle harus sama persis.</Tip>\\n\\n<img src={disableStyle} alt=\\"disableStyle.gif\\" width=\\"340\\" height=\\"585\\" />\\n\\n### Unduh subtitle dalam urutan yang sama seperti yang ditampilkan\\n\\n<img src={order} alt=\\"order.gif\\" width=\\"340\\" height=\\"585\\" />\\n\\n<WebStore />"},{"id":"/3_5_0","metadata":{"permalink":"/id/3_5_0","source":"@site/i18n/id/docusaurus-plugin-content-blog/3_5_0/index.mdx","title":"Catatan Pembaruan YouTube\u2122 Dual Caption 3.5.0","description":"Gaya font khusus","date":"2021-08-24T00:00:00.000Z","formattedDate":"24 Agustus 2021","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2021-08-24T00:00:00.000Z"},"prevItem":{"title":"Catatan Pembaruan YouTube\u2122 Dual Caption 3.6.0","permalink":"/id/3_6_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport Tip from \'/src/components/Tip\';\\nimport light from \'./light.png\';\\nimport dark from \'./dark.png\';\\nimport tip from \'./tip.gif\';\\nimport singlebutton from \'./singlebutton.png\';\\nimport single from \'./single.png\';\\nimport translationError from \'./translationError.gif\';\\n\\n\\n### Gaya font khusus\\n\\nKlik ikon ekstensi untuk memunculkan halaman pengaturan untuk mendukung mode gelap.\\n\\nOpsi kustom: font, ukuran font, warna, warna latar belakang, spasi, dan urutan subtitle.\\n\\n<img src={light} alt=\\"light.png\\" width=\\"340\\" height=\\"472\\" />\\n<img src={dark} alt=\\"dark.png\\" width=\\"340\\" height=\\"472\\" />\\n\\n<Tip>Melayang di atas ikon akan mengungkapkan apa yang diwakili oleh pengaturan tersebut.</Tip>\\n\\n<img src={tip} alt=\\"tip.gif\\" width=\\"340\\" height=\\"472\\" />\\n\\n### Gaya subtitle tunggal\\n\\nSetelah beralih ke mode subtitle tunggal, gaya subtitle tunggal dapat diatur secara independen.\\n\\n<img src={singlebutton} alt=\\"singlebutton.png\\" width=\\"314\\" height=\\"372\\" />\\n<img src={single} alt=\\"single.png\\" width=\\"340\\" height=\\"406\\" />\\n\\n### Pengoptimalan lainnya\\n\\nHapus pustaka program Tradisional Cina ke Sederhana, kurangi ukuran program, dan tingkatkan kinerja, karena YouTube telah memperbaiki bug ini secara resmi.\\n\\n<Tip>Terkadang subtitle hilang, sebagian besar karena kesalahan terjemahan YouTube.</Tip>\\n\\n<img src={translationError} alt=\\"translationError.gif\\" width=\\"700\\" height=\\"396\\" />\\n\\nDi masa depan, mesin terjemahan lain akan diperkenalkan untuk memecahkan masalah ini dan menebus ketidakakuratan terjemahan.\\n\\n<WebStore />"}]}')}}]);